// App.js
import './propertyForm.css';
import React, { useState } from 'react';
import './propertyForm.css';

function App() {
  const [formData, setFormData] = useState({
    currentMarketValue: 0,
    carpetArea: 0,
    pincode: '',
    ageOfBuilding: '',
    affectedByDisaster: 'No',
    security24x7: 'No',
    isSalaried: 'No',
  });

  const [totalSum, setTotalSum] = useState(0);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const calculateSum = () => {
    let sum = 0;

    sum += 0.01 * formData.currentMarketValue;
    sum += formData.currentMarketValue;
    sum += formData.carpetArea;

    switch (formData.ageOfBuilding) {
      case '0-5years':
        sum += 100;
        break;
      case '5-10years':
        sum += 200;
        break;
      case '10-15years':
        sum += 300;
        break;
      case '15-20years':
        sum += 400;
        break;
      case '20-25years':
        sum += 500;
        break;
      default:
        break;
    }

    if (formData.affectedByDisaster === 'Yes') {
      sum += 100;
    }

    if (formData.security24x7 === 'Yes') {
      sum += 100;
    } else {
      sum -= 200;
    }

    if (formData.isSalaried === 'Yes') {
      sum += 150;
    } else {
      sum += 50;
    }

    setTotalSum(sum);
  };

  const handleProceed = () => {
    calculateSum();
    alert(`Estimated Sum of details: ${totalSum}`);
  };

  return (
    <div className="container">
      <div>
        <h2>Structure Details</h2>
        <label>
          Current Market Value of Property:
          <input
            type="number"
            name="currentMarketValue"
            value={formData.currentMarketValue}
            onChange={handleInputChange}
          />
        </label>
        <br />
        <label>
          Carpet Area/sq.ft:
          <input
            type="number"
            name="carpetArea"
            value={formData.carpetArea}
            onChange={handleInputChange}
          />
        </label>
        <br />
        <label>
          Enter Pincode:
          <input
            type="text"
            name="pincode"
            value={formData.pincode}
            onChange={handleInputChange}
          />
        </label>
        <br />
        <label>
          Age of Building:
          <select
            name="ageOfBuilding"
            value={formData.ageOfBuilding}
            onChange={handleInputChange}
          >
            <option value="">Select</option>
            <option value="0-5years">0-5 years</option>
            <option value="5-10years">5-10 years</option>
            <option value="10-15years">10-15 years</option>
            <option value="15-20years">15-20 years</option>
            <option value="20-25years">20-25 years</option>
          </select>
        </label>
        <br />
        <label>
          Has your property been affected by floods/earthquake in the past 5 years:
          <select
            name="affectedByDisaster"
            value={formData.affectedByDisaster}
            onChange={handleInputChange}
          >
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>
      </div>

      <div>
        <h2>Security Measures</h2>
        <label>
          24*7 Security:
          <select
            name="security24x7"
            value={formData.security24x7}
            onChange={handleInputChange}
          >
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>
        <br />
        <label>
          Are you a salaried individual?:
          <select
            name="isSalaried"
            value={formData.isSalaried}
            onChange={handleInputChange}
          >
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>
      </div>

      <button onClick={handleProceed}>Proceed</button>

      <div id="totalSum">
        <h2>Estimated Total Sum of Details</h2>
        <p>{totalSum}</p>
      </div>
    </div>
  );
}

export default App;
